const Fetch = require('node-fetch');

let url = "http://spreadsheets.google.com/feeds/list/1BnexUjj1ke_HEg3TlIkJZ6wz3utvxDUwSN4Qr2eRPmo/od6/public/values?alt=json";

let settings = { method: "Get" };

Fetch(url, settings)
    .then(res => res.json())
    .then((json) => {
        alert(JSON.stringify(json));
        // do something with JSON
    });
